import { RANKING } from '../actions';

const INITIAL_STATE = [
  { name: nome - da - pessoa, score: 10, picture: url - da - foto - no - gravatar },
];

const ranking = (state = INITIAL_STATE, action) => (actions.type === RANKING
  ? [...state, action.payload]
  : state);

export default ranking;
